import React, { Component } from "react";

class App extends Component {
  state = {
    post: [],
    loading: true,
    error: null,
  };

  nameFetch(event) {
    event.preventDefault();
    fetch("https://jsonplaceholder.typicode.com/posts")
      .then((response) => response.json()) // Преобразуем ответ в JSON
      .then((data) => console.log("Данные с сервера:", data)) // Выводим данные
      .catch((error) => console.error("Ошибка запроса:", error)); // Ловим ошибки
  }
  render() {
    return (
      <div className="App">
        <form onSubmit={this.nameFetch}>
          <input />
          <input />
          <button type="submit">button</button>
        </form>
      </div>
    );
  }
}

export default App;
